using System;using System.Collections.Generic;using System.Text.Json.Serialization;namespace MicroFeel.Yonyou.Api{	public class Duty	{		///<Summary>		///职务编码		///</Summary>		[JsonPropertyName("dutycode")]		public string Dutycode { get;set; }		///<Summary>		///职务名称		///</Summary>		[JsonPropertyName("dutyname")]		public string Dutyname { get;set; }		///<Summary>		///职务簇		///</Summary>		[JsonPropertyName("series")]		public string Series { get;set; }		///<Summary>		///工作概要		///</Summary>		[JsonPropertyName("dutysumm")]		public string Dutysumm { get;set; }		///<Summary>		///职务级别		///</Summary>		[JsonPropertyName("dutylev")]		public string Dutylev { get;set; }		///<Summary>		///设立日期		///</Summary>		[JsonPropertyName("begindate")]		public string Begindate { get;set; }		///<Summary>		///撤销日期		///</Summary>		[JsonPropertyName("enddate")]		public string Enddate { get;set; }		///<Summary>		///时间戳		///</Summary>		[JsonPropertyName("timestamp")]		public float Timestamp { get;set; }	}}